const ProductList = ({ products, handleIncrease, handleDecrease }) => {
  return (
    <div>
      {products.map(product => (
        <div key={product.id}>
          <p>{product.item} - Estoque: {product.quantidade_estoque}</p>
          <button onClick={() => handleIncrease(product.id)}>Aumentar Caixas</button>
          <button onClick={() => handleDecrease(product.id)}>Diminuir Caixas</button>
        </div>
      ))}
    </div>
  );
};

export default ProductList;
